import React, { Component } from 'react';
import { BrowserRouter, Switch, Route, Link } from 'react-router-dom';
import LoginUsuario from './components/LoginUsuario';
import AppUsuario from './components/AppUsuario';
import TipoIngreso from './components/TipoIngreso';
import Error from './components/Error';
import Index from './components/Index';

class Rutas extends Component {

    render() {

        return (

                    <BrowserRouter>
                      <Switch>

                        <Route exact path= "/" component= {Index} />
                        <Route exact path= "/TipoIngreso" component= {TipoIngreso} /> 
                        <Route exact path= "/LoginUsuario" component= {LoginUsuario} />
                        <Route exact path= "/Usuario" component= {AppUsuario} />
                        <Route component= {Error} />

                      </Switch>

                    </BrowserRouter>




        );



    }


}

export default Rutas;
